script: |
  super -f text -I q3326.spq | sort > q3326.out

inputs:
  - name: q3326.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE + col2 BETWEEN - col0 + + ( - ( col2 ) ) + + 88 * + CAST ( col1 AS INTEGER ) * + col1 AND col0;
  - name: tab2

outputs:
  - name: q3326.out
    data: |
